  @override
  String get info_privacy_policy => 'Introducción.\n\nNosotros tomamos sus derechos de privacidad muy en serio y queremos que usted se sintiera cómodo en Zerobolas Marketplace. Esta política de privacidad se ocupa de la información personal identificable (designada “datos” abajo) que es recogida por nosotros en nuestro sitio. Esta política no se aplica a otras entidades que no poseamos o no controlemos, o a las personas que no son nuestros empleados o agentes. Tome por favor el tiempo para leer nuestros términos de uso.\n\n1. Recolección de Datos.\n\nNuestro proceso de registro requiere de una dirección válida del E-mail, una identificación del usuario, una contraseña y los campos en negrita requeridos. Proveernos con otra información es su opción. Tome por favor nota que su nombre de usuario, su dirección de E-mail, u otras sumisiones que usted haga en este sitio pueden contener su nombre verdadero o la otra información personal identificable y, consecuentemente, pueden aparecer en este sitio. Como muchos sitios de la internet, podemos también recibir automáticamente la información de carácter general que contiene en nuestros ficheros de diario del servidor tales como su dirección IP o información de cookies. Información sobre como los clasificados puede servir en este sitio (si en todos), se puede ver debajo. zerobolas.com puede enviar notificaciones o mensajes de usuarios interesados en sus anuncios a través del e-mail con cuál se hizo la subscripción. Puedes de-subscribirse de estos e-mails. zerobolas.com no le solicitará por teléfono o por email los datos de tarjeta de crédito. El único momento en que debe ofrecer sus datos, es en línea y directo por medio de la pasarela de pago de Stripe.com, 2Checkout.com, y PayPal.\n\n2. Consentimiento a uso de la información.\n\nEl registro de cuenta y publicación de anuncios en zerobolas.com implica que la información del anunciante estará disponible públicamente en nuestra red de sitios a fin de facilitar a los potenciales consumidores interesados el contacto con el anunciante.\n\nUsted acepta que zerobolas.com podrá suministrar o compartir información y datos recolectados de su cuenta y sus cuentas relacionadas con las autoridades, en los casos que así lo estime conveniente o bajo solicitud expresa de estas.\n\n3. Condiciones del consentimiento y eliminación de cuenta.\n\nLos usuarios registrados que deseen la eliminación de su cuenta, pueden requerirlo vía email a través de hola@zerobolas.com. Este proceso puede tardar entre 3 y 5 días hábiles. En casos de emergencia, la eliminación de su cuenta puede ser solicitada telefónicamente llamando a los teléfonos en la parte inferior. Es importante recalcar que en caso de eliminación de cuenta, zerobolas.com despublicará la información del usuario y sus anuncios de su red de sitios, sin embargo, la empresa no controla ni es responsable por los listados publicados en otros buscadores como Google, Yahoo, Bing ni cualquier otro sitio no relacionado con zerobolas.com\n\n4. Uso de datos\n\nPodemos utilizar datos para modificar y para mejorar su experiencia como usuario de este Sitio. Haremos esfuerzos de modo que sus datos no sean proporcionados a terceros a menos que:\n\n4.1. preverá de otra manera dentro de esta política de privacidad;\n\n4.2. obtengamos su consentimiento, por ejemplo, cuando usted elige a OPT-in o OPT-out a compartir de datos;\n\n4.3. Un servicio proporcionado en nuestro sitio requiere la interacción con o es proporcionado por terceros, a modo de ejemplo un abastecedor de servicio del uso;\n\n4.4. conforme a la aplicación legal del proceso o de ley;\n\n4.5. encontramos que con el uso de este sitio usted viola nuestra política, términos del servicio, otras pautas del uso o según lo juzgado razonablemente necesario por nosotros para proteger nuestros derechos legales y/o propiedad;\n\n4.6. este sitio es comprado por terceros por lo que esos terceros puedan utilizar los datos de manera semejante a nosotros según lo dispuesto en esta política. En el acontecimiento usted elija utilizar los acoplamientos que aparecen en nuestro sitio para visitar otros sitios. Se le aconseja a usted leer las políticas de privacidad que aparecen en esos sitios.\n\n5. Cookies.\n\nComo muchos sitios de Internet, fijamos y utilizamos las cookies para realzar su experiencia como usuario, tal como retención de sus ajustes personales. Los anuncios pueden aparecer en nuestro Web site y, si es así pueden fijar y tener acceso a las cookies en su computadora y están conforme a la política de privacidad de esas partes que proporcionan el anuncio. Disponga de más información sobre las Cookies en: http://es.wikipedia.org/wiki/Cookie\n\n5.1.Cookie de DART de DoubleClick. Google utiliza la cookie de DART de DoubleClick en los anuncios publicados en sitios web como este que muestran anuncios de AdSense para contenido. El uso de la cookie DART permite a Google publicar anuncios a usuarios que visitan sus sitios y otros sitios de Internet. Google utiliza empresas publicitarias asociadas para publicar anuncios cuando los usuarios visitan nuestro sitio web. Es posible que estas empresas usen la información que obtienen de las visitas a este y a otros sitios web (sin incluir nombre, dirección, dirección de correo electrónico o número de teléfono) para ofrecer a los usuarios anuncios sobre productos y servicios que les resulten de interés. *Como usuario puede inhabilitar el uso de la cookie de DART accediendo al anuncio de Google y a la política de privacidad de la red de contenido: http://www.google.com/privacy_ads.html\n\n5.2. Web Beacons Este sitio puede albergar también web beacons (también conocidos por web bugs). Los web beacons suelen ser pequeñas imágenes de un pixel por un pixel, visibles o invisibles colocados dentro del código fuente de las páginas web de un sitio. Los Web beacons sirven y se utilizan de una forma similar a las cookies. Además, los web beacons suelen utilizarse para medir el tráfico de usuarios que visitan una página web y poder sacar un patrón de los usuarios de un sitio. Disponga de más información sobre los web beacons en: http://es.wikipedia.org/wiki/Web_bug\n\n6. Niños.\n\nNo permitimos a personas menores de trece (13) años a ser miembros de este sitio. Para más información, por favor entre en contacto con nuestro webmaster.\n\n7. Corrigiendo o retirando su información de la cuenta.\n\nNosotros le damos la capacidad de corregir la información en su cuenta de usuario que usted nos proporcionó en el registro usando su área personal de la configuración de la página. Usted puede solicitar la cancelación de su cuenta de usuario entrando en contacto con nuestro nuestro webmaster. El contenido u otros datos que usted pudo haber proporcionado y que no están dentro de su cuenta de usuario, tal como mensajes que puedan aparecer dentro de nuestros foros, puede continuar apareciendo en nuestro sitio a discreción nuestra aunque se elimina su cuenta de usuario. Vea por favor nuestros términos de uso para más información.\n\n8. Cambio de esta política de privacidad.\n\nPodemos realizar cambios a esta Política de Privacidad en cualquier momento. Le notificaremos de cambios substanciales a esta política o fijando un aviso prominente en nuestro sitio y/o enviándole un mensaje a la dirección del E-mail que nos ha proporcionado y que está en el contenido de sus ajustes de usuario.\n\n9. No ofrecemos Garantías.\n\nMientras que esta Política de Privacidad indica que nuestros estándares para el mantenimiento datos y de nosotros harán esfuerzos de resolverlos, no estamos en una posición para garantizar estos estándares. Puede haber factores más allá de nuestro control que pueda dar lugar al acceso de datos. Por consiguiente, negamos cualquier garantía o representación referentes al mantenimiento o al no acceso de datos.\n\n10. Información del Contacto.\n\nSi usted tiene cualquier pregunta sobre esta Política de Privacidad o nuestro Web site, por favor siéntase libre de entrar en contacto con nuestro webmaster\n\n11. Correos Electrónicos\n\nA fin de dejar de recibir correos electrónicos enviados por zerobolas.gt, debes iniciar con hacer clic el link de \\\"Unsubscribe\\\" localizado en la parte inferior de el correo enviado. De acuerdo a tu nivel de usuario puede que la de-suscripción sea inmediatamente tras hacer clic en el link. Si ya tienes una cuenta de usuario debidamente registrado, tendrás que ingresar en la cuenta con tu password y login antes de hacer clic en Confirmar la de-suscripción.\n\nSi solo deseas dejar de recibir ciertos correos electrónicos de zerobolas.gt y no otros, puedes gestionar estas opciones desde tu cuenta. Entras en tu cuenta desde el Login. Ingresas en tu cuenta con tu login y password. Bajo el menu Perfil > Configuración > Notificaciones puedes deseleccionar las notificaiones que no te interese recibir.';

